import React from 'react';
import { connect} from 'redux-bundler-react';
import DeleteButton from '../delete-button';
import ToggleButton from '../toggle-button';

class AoiListItem extends React.Component{
    render(){
        const { geometry, modify, drawSelect, doDrawAddInteraction } = this.props;
        const tools = [{
            toolTip: "Modify AOI Features",
            className: "ms ms-pencil",
            interaction: modify
        }
    
    ]

        return <li 
            className="list-group-item-primary d-flex justify-content-between align-items-center"
            onClick={() => {
                    doDrawAddInteraction(drawSelect)
                }
            }
        >
            {geometry.getProperties().created_by}
            {tools.map((item, i) => {
                        return(
                            <ToggleButton
                            key = {i}
                            toolTip = {item.toolTip}
                            className = {item.className}
                            interaction = {item.interaction}
                            />
                        )
                    })
                }
        <span><button className="btn btn-info mr-2">Download </button></span>
        <span><DeleteButton/></span>
        </li>
    }
}
export default connect(
    "doDrawAddInteraction",
    "selectDrawSelect",
    "selectModify",
     AoiListItem
)
